import React from 'react';
import { ModalBody } from 'react-bootstrap';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import { createNoSubstitutionTemplateLiteral } from 'typescript';

type SubmitConfirmationProps = {
  show: boolean
  onHide: () => void
  data: any
}

type ElementObject = {
  key: string,
  value: string
}

const SubmitConfirmation = (props: SubmitConfirmationProps) => {

  const formatData = (data:any) => {
    if (data.object !== undefined) {
      data.object.forEach((element: any) => {
        console.log(element);
      });
    }
  }

  return(
    <Modal show={props.show} onHide={props.onHide}>
      <Modal.Header closeButton>
          <Modal.Title>Review Damage/Defect Submission</Modal.Title>
      </Modal.Header>
      <ModalBody>
        {/* {JSON.stringify(props.data, null, 1)} */}
        {formatData(props.data)}
      </ModalBody>
      <Button type="submit">Submit</Button>
    </Modal>
  );
};

export default SubmitConfirmation;
